import CamisasIMG from '../assets/categories/camisetas.png';
import BermudasIMG from '../assets/categories/bermudas.JPG';
import CasacosIMG from '../assets/categories/casacos.jpg';
import AcessoriosIMG from '../assets/categories/acessorios.jpg';

export default [
  { label: 'Camisetas', photo: CamisasIMG, link: 'produtos/camisetas' },
  { label: 'Bermudas', photo: BermudasIMG, link: 'produtos/camisetas' },
  { label: 'Casacos', photo: CasacosIMG, link: 'produtos/camisetas' },
  { label: 'Acessorios', photo: AcessoriosIMG, link: 'produtos/camisetas' }
];
